  // SPDX-License-Identifier: MIT
pragma solidity >=0.8.0 <0.9.0;
library XpectoLib{

    struct XpectoData{
        string customerNumber; // !=0 needs to be converted to striing before sending to xpecto 
        string memo;//??
    }

    function setIdentityXpectoData(
        string memory _customerNumber,
        string memory _memo
        )
        public 
        pure
        returns(XpectoData memory){

            return XpectoData({
                customerNumber:_customerNumber,
                memo: _memo
            });
        }
}
